import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Button, Form } from 'react-bootstrap';
import axios from 'axios';

const IndustryNews = () => {
  const [news, setNews] = useState([]);
  const [selectedArticle, setSelectedArticle] = useState(null);
  const [reply, setReply] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchNews = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/industry-news');
        setNews(response.data);
      } catch (err) {
        setError('Error fetching news');
      }
    };

    fetchNews();
  }, []);

  const handleArticleClick = async (id) => {
    try {
      const response = await axios.get(`http://localhost:5000/api/industry-news/${id}`);
      setSelectedArticle(response.data);
    } catch (err) {
      setError('Error fetching article');
    }
  };

  const handleReplySubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post(`http://localhost:5000/api/industry-news/${selectedArticle.id}/reply`, { message: reply });
      setReply('');
      handleArticleClick(selectedArticle.id);  // Refresh the article with the new reply
    } catch (err) {
      setError('Error posting reply');
    }
  };

  return (
    <Container>
      <Row>
        <Col md={8}>
          <h2>Industry News</h2>
          {error && <p>{error}</p>}
          {news.map(article => (
            <Card key={article.id} className="mb-3" onClick={() => handleArticleClick(article.id)}>
              <Card.Body>
                <Card.Title>{article.title}</Card.Title>
                <Card.Text>{article.content.slice(0, 100)}...</Card.Text>
                <Button variant="link">Read More</Button>
              </Card.Body>
            </Card>
          ))}
        </Col>

        <Col md={4}>
          {selectedArticle && (
            <>
              <h3>{selectedArticle.title}</h3>
              <p>{selectedArticle.content}</p>
              <h5>Companies Mentioned:</h5>
              <ul>
                {selectedArticle.companies.map(company => (
                  <li key={company}>{company}</li>
                ))}
              </ul>
              <hr />
              <h5>Replies</h5>
              {selectedArticle.replies.map((r, index) => (
                <div key={index}>
                  <strong>{r.user}:</strong> <p>{r.message}</p>
                  <small>{new Date(r.date).toLocaleString()}</small>
                  <hr />
                </div>
              ))}

              <Form onSubmit={handleReplySubmit}>
                <Form.Group>
                  <Form.Label>Reply:</Form.Label>
                  <Form.Control
                    type="text"
                    value={reply}
                    onChange={(e) => setReply(e.target.value)}
                    placeholder="Write your reply here"
                  />
                </Form.Group>
                <Button type="submit" variant="primary">Post Reply</Button>
              </Form>
            </>
          )}
        </Col>
      </Row>
    </Container>
  );
};

export default IndustryNews;
